import React from 'react'
import './ProjectCard.css';

const ProjectCard = ({title, tags, description, img}) => {
  return (
    <div className="card-content">
        <img src={img} alt={title} />
        <h4>{title}</h4>
    </div>
  )
}

export default ProjectCard;
